 import React from "react";
 import product_cart from "../data/product_data";
import Box from '@mui/material/Box';
import './mainproduct.css';

 const Mainproduct = () => {


const listItem=product_cart.map((item)=>
<Box className="body" sx={{ backgroundColor:"black"}} >
<Box className="cart" key={item.id} sx={{backgroundColor:"red"}}>
<Box sx={{backgroundColor:"yellow"}} >
<img src={item.thumb} alt="Logo" style={{ height: '100px', margin: '10px', flexGrow: 1 }} />
</Box>

<Box classname="card_header" sx={{backgroundColor:"purple"}}>
<h2>{item.name}</h2>
<p>{item.description}</p>
<p className="price"><span>{item.price}</span></p>
<div className="consult item" sx={{backgroundColor:"orange"}}></div>

</Box>

    </Box>
    </Box>
 );




return (
  <Box
    style={{
      marginTop: '0',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height:"100%",
      backgroundColor: 'white',
    }}
  >
    <Box
      style={{
        marginTop: '0',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        maxWidth: '1580px',
        overflow: 'auto',
        backgroundColor:"bleu"
      }}
    >
      <Box className="main_content" sx={{display:"flex",
    justifycontent: "center",
    alignItems:"center"}}  >
          {listItem}
      </Box>
     
      
    </Box>
  </Box>
);
}

 export default  Mainproduct;
